import { Col, Row } from "react-bootstrap";
import "./CategoryLeft.css";

const CategoryLeft = ({ categoryAll }) => {
  return (
    <>
      {categoryAll.map((data, inx) => {
        return (
          <div className="category-left-box">
            <Row style={{ width: "100%" }}>
              <Col xl={3}>
                <img
                  src="https://static.8cache.com/cover/eJzLyTDWr8g0KCmwdHIMCMp0MTQsNw9yMzXyczXLMXTyiTfNcEv3twzPzIvMTXRycwvON8gJzst1CsgLdw5zTDQ3SgyLMCkvLCgyL64odfENi_Dxcgq1LTe0MNDNsDAAAGc3HW8=/than-dao-dan-ton-6060282.jpg"
                  alt=""
                />
              </Col>
              <Col xl={7} className="align-content-center">
                <h3>
                  Phàm Nhân Tu Tiên Chi Tiên Giới Thiên (Phàm Nhân Tu Tiên 2)
                </h3>
                <h6>Cô Đơn Địa Phi</h6>
              </Col>
              <Col xl={2} className="align-content-center">
                <span>Chương 5344</span>
              </Col>
            </Row>
          </div>
        );
      })}
    </>
  );
};

export default CategoryLeft;
